Como não aplaudir essa nova geração? Crianças assumem o protagonismo do projeto “MI CASA TU CASA” assumindo a linha de frente do movimento de arrecadação de livros infantis em português e espanhol, para serem doados para crianças e adolescentes refugiados Venezuelanos, que se encontram nos abrigos em Romaima. Em apenas 50 dias já arrecadaram mais de 20 mil livros infantis e aproximadamente 2 mil cartas. Sabemos que promover a integração entre crianças refugiadas com as brasileiras é de extrema importância para a educação e desenvolvimento de cada uma, além da demonstração de empatia pela dura realidade e desafios que elas enfrentam todos os dias. Agora é a vez dos adultos fazerem parte desse movimento, contribuindo no financiamento coletivo para que seja possível o envio dos livros e a construção de armário-bibliotecas em abrigos ou em locais de acolhimento de refugiados no estado de Roraima. 
Contribua e compartilhe! Esse é um projeto realizado pelo Jornal Joca e a instituição Hands On Humans Rights em parceria com ACNUR ( Agência da ONU para os refugiados). Vamos tornar todo esforço das crianças  possível e fazer a nossa parte nesse lindo e necessário projeto! 

